import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Login from "./components/Login";
import Register from "./components/Register";
import PrivateRoute from "./components/PrivateRoute";

// Student Components
import Home from "./components/Student/Home";
import About from "./components/Student/About";
import Class from "./components/Student/Class";
import Profile from "./components/Student/Profile";
import Detail from "./components/Student/Detail";

// Tutor Components
import HomeTutor from "./components/Tutor/HomeTutor";
import AboutTutor from "./components/Tutor/AboutTutor";
import ClassTutor from "./components/Tutor/ClassTutor";
import ProfileTutor from "./components/Tutor/ProfileTutor";
import CreateClassTutor from "./components/Tutor/CreateClassTutor";
import EditClassTutor from "./components/Tutor/EditClassTutor";
import EditProfileTutor from "./components/Tutor/EditProfileTutor";
import DetailTutor from "./components/Tutor/DetailClassTutor";

const App = () => {
  return (
    <Router>
      <Routes>
        {/* Public Routes */}
        <Route path="/register" element={<Register />} />
        <Route path="/" element={<Login />} />

        {/* Student Routes */}
        <PrivateRoute path="/home" element={<Home />} />
        <PrivateRoute path="/about" element={<About />} />
        <PrivateRoute path="/class" element={<Class />} />
        <PrivateRoute path="/profile" element={<Profile />} />
        <PrivateRoute path="/class/:class_id" element={<Detail />} />

        {/* Tutor Routes */}
        <PrivateRoute path="/tutorhome" element={<HomeTutor />} />
        <PrivateRoute path="/tutorabout" element={<AboutTutor />} />
        <PrivateRoute path="/tutorclass" element={<ClassTutor />} />
        <PrivateRoute path="/tutorclass/:class_id" element={<DetailTutor />} />
        <PrivateRoute path="/tutorprofile" element={<ProfileTutor />} />
        <PrivateRoute path="/create-class" element={<CreateClassTutor />} />
        <PrivateRoute path="/tutorprofile/edit/:class_id" element={<EditClassTutor />}
        />
        <PrivateRoute path="/tutor/edit/:tutor_id" element={<EditProfileTutor />} />
      </Routes>
    </Router>
  );
};

export default App;
